import React from "react"

export default class LoginPage extends React.Component{
  constructor(props){
    super(props)
    this.state = {
      enteredUsername: '',
      enteredPassword: '',
    }
  }

  render(){
    return(
      <div>
        <input type="text" placeholder="Username"/>
        <input type="text" placeholder="Password"/>
      </div>
    )  
  }
}
